const Gotobtn = () => {
    const goToBtn = () =>{
        window.scrollTo({top:0,left:0,behavior: "smooth"});
    }
  return (
    <div classname="top-btn" onClick={goToBtn}>
        <h2 style={{
            color: white
        }}>Up</h2>
      
    </div>
  )
}

export default Gotobtn;
